import BubbleBox from "../Presenter/BubbleBox";
import MainChatLogPresenter from "../Presenter/MainChatLogPresenter";


const MainChatLogContainer = () => {
    return (
        <MainChatLogPresenter>
            <BubbleBox>
                <Name>이상철</Name>
                <Date>5:23 PM</Date>
                <Content>안녕하세요 여러분~!</Content>
            </BubbleBox>
        </MainChatLogPresenter>
    )
}

export default MainChatLogContainer;
